import './App.css';
import Header from './components/Header/Header';
import Posts from './components/Posts/Posts';
// import {useEffect} from 'react';

import {BrowserRouter as Router, Routes,Route} from 'react-router-dom'


function App() {


  return (
    <div className= "App">
      <div></div>
      <Router>
        <Header />
        <Routes>
            <Route path='/' element={<Posts />} />
        </Routes>
      </Router>


    </div>
  );
}

export default App;
